import React from "react";
import styled from "styled-components";

const LogoWrapper = styled.div``;

const Home = () => {
  return (
    <div>
      <header>
        <LogoWrapper>
          <img src="images/temp_logo.png" />
        </LogoWrapper>
      </header>
      <section className="img-container">
        <img src="" className="" />
        그림!
      </section>
      <section className="steps-container">
        <article className="steps step1"></article>
        <article className="steps step2">색깔3</article>
        <article className="steps step3">색깔5</article>
        <article className="steps step4">색깔6</article>
      </section>
      색깔4
      <footer></footer>
    </div>
  );
};

export default Home;
